		}else {
			name(s);
		}
	}
	function f() {
			if("WebSocket" in window){
				ws = new WebSocket(target);
				
			}else if("MozWebSocket" in window){
				ws = new MozWebSocket(target);

				alert("不支持您使用的浏览器");

				var a = event.data.split(":");

			};
			
		}
		function name(id) {
			if(ws.readyState == 1) {
				ws.send("acc,"+id);
			}
			
			
			setTimeout(function(){ 
			name(id);
